import React from 'react';
import {whatshot} from 'react-icons/md';

function BottomNav() {

    return(
        <div className='NavContainer' style={{display: 'flex', flexDirection: 'row'}}>
            <div className='Channels' style={{display: 'flex'}}>
                <button style={{width: 100, height: 80, backgroundColor: '#fff'}}>Channels</button>
                <whatshot />
            </div>
            <div className='Feed' style={{display: 'flex'}}>
                <button style={{width: 100, height: 80, backgroundColor: '#fff'}}>Feed</button>
            </div>
            <div className='Options' style={{display: 'flex'}}>
                <button style={{width: 100, height: 80, backgroundColor: '#fff'}}>Options</button>
            </div>
        </div>
    )
}

export default BottomNav;
